import "./App.css";
import React from "react";
import { useNavigate } from "react-router-dom";

function App() {
  let navigate = useNavigate();
  function handleClick(crn) {
    navigate(crn);
  }

  return (
    <div className="App">
      <div>
        <h1>tekkanji</h1>
        <h2>テック + かんじ</h2>
        <h3>a kanji learning system for JAPN at Georgia Tech</h3>
        <div className="class">
          <div>which class are you taking?</div>
          <div className="classOptions">
            <button onClick={handleClick("../1001")}>japn 1001</button>
            <button onClick={handleClick("../1002")}>japn 1002</button>
            <button>japn 2001</button>
            <button>japn 2002</button>
            <button>japn 3001</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
